script: |
  super -f text -I q10678.spq | sort > q10678.out

inputs:
  - name: q10678.spq
    data: |
      SELECT 5 + - 6 * - + col1 + - + 68 + col0 * + + col1, ( - ( - - 89 ) ) * + - col0 + - ( - col1 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q10678.out
    data: |
      1638	1416
      1890	7764
      40	8634
